<body class="bg-gray-50 text-gray-800 font-sans">
    <div class="container mx-auto px-4 py-8">
        <h1 class="text-3xl font-bold text-center mb-6">Privacy Policy</h1>
        <p class="text-sm text-gray-600 mb-4"><strong>Effective Date:</strong> January 31, 2025</p>
        <a href="https://www.collegeinfonepal.com" class="text-sm text-gray-600 cursor-pointer mb-6"><strong>Website:</strong> www.collegeinfonepal.com</a>
        
        <h2 class="text-2xl font-semibold mb-3">1. Introduction</h2>
        <p class="mb-4">College Info Nepal Pvt Ltd ("Company," "we," "our," or "us") respects your privacy and is committed to protecting your personal information. This Privacy Policy explains how we collect, use, and protect your data when you use our website www.collegeinfonepal.com ("Website") and our college registration and course discovery services. By using our services, you agree to the terms outlined in this Privacy Policy.</p>
        
        <h2 class="text-2xl font-semibold mb-3">2. Information We Collect</h2>
        <h3 class="text-xl font-semibold mb-2">a) Personal Information</h3>
        <p class="mb-4">We collect personal data when you register on our Website, browse colleges, apply for courses, or communicate with us. This may include:</p>
        <ul class="list-disc ml-6 mb-4">
            <li>Full name</li>
            <li>Email address</li>
            <li>Phone number</li>
            <li>Date of birth</li>
            <li>Address and location</li>
            <li>Educational background</li>
            <li>Course preferences</li>
            <li>Payment details (for premium services or course applications)</li>
        </ul>
        
        <h3 class="text-xl font-semibold mb-2">b) Non-Personal Information</h3>
        <p class="mb-4">We collect non-personal data automatically when you visit our Website, such as:</p>
        <ul class="list-disc ml-6 mb-4">
            <li>IP address</li>
            <li>Browser type and version</li>
            <li>Device information</li>
            <li>Website usage data (e.g., pages visited, time spent on pages)</li>
            <li>Cookies and tracking data</li>
        </ul>
        
        <h2 class="text-2xl font-semibold mb-3">3. How We Collect Your Information</h2>
        <ul class="list-disc ml-6 mb-4">
            <li>Direct submission (e.g., when you register, apply for courses, or contact us)</li>
            <li>Third-party integrations (e.g., college application portals, payment processors)</li>
            <li>Automated tracking technologies (e.g., cookies, analytics tools)</li>
        </ul>
        
        <h2 class="text-2xl font-semibold mb-3">4. How We Use Your Information</h2>
        <h3 class="text-xl font-semibold mb-2">College and Course Discovery:</h3>
        <ul class="list-disc ml-6 mb-4">
            <li>To help students explore colleges and courses.</li>
            <li>To facilitate direct inquiries between students and colleges.</li>
            <li>To personalize recommendations based on user preferences.</li>
        </ul>
        
        <h3 class="text-xl font-semibold mb-2">Application Services:</h3>
        <ul class="list-disc ml-6 mb-4">
            <li>To allow students to apply for courses through our platform.</li>
            <li>To send application updates and confirmations.</li>
        </ul>
        
        <h3 class="text-xl font-semibold mb-2">Website and Service Improvements:</h3>
        <ul class="list-disc ml-6 mb-4">
            <li>To enhance user experience.</li>
            <li>To analyze and improve Website functionality.</li>
        </ul>
        
        <h3 class="text-xl font-semibold mb-2">Marketing and Communication:</h3>
        <ul class="list-disc ml-6 mb-4">
            <li>To send updates on colleges, courses, and application deadlines.</li>
            <li>To send promotional emails (you can opt-out anytime).</li>
        </ul>
        
        <h3 class="text-xl font-semibold mb-2">Legal and Compliance Purposes:</h3>
        <ul class="list-disc ml-6 mb-4">
            <li>To prevent fraud and unauthorized access.</li>
            <li>To comply with legal and regulatory requirements.</li>
        </ul>
        
        <h2 class="text-2xl font-semibold mb-3">5. How We Share Your Information</h2>
        <ul class="list-disc ml-6 mb-4">
            <li><strong>Colleges and Universities:</strong> If you express interest in a college, your relevant details may be shared with them.</li>
            <li><strong>Service Providers:</strong> Third-party vendors assisting with payment processing, marketing, or analytics.</li>
            <li><strong>Legal Authorities:</strong> If required by law, regulation, or legal proceedings.</li>
        </ul>
        
        <h2 class="text-2xl font-semibold mb-3">6. Data Security</h2>
        <ul class="list-disc ml-6 mb-4">
            <li>Secure servers and encryption technologies.</li>
            <li>Restricted access to sensitive information.</li>
            <li>Regular security audits and monitoring.</li>
        </ul>
        <p class="mb-4">Despite our efforts, no online platform is 100% secure. We advise users to take precautions while sharing personal data online.</p>
        
        <h2 class="text-2xl font-semibold mb-3">7. Your Rights and Choices</h2>
        <ul class="list-disc ml-6 mb-4">
            <li><strong>Access and Correction:</strong> You can request a copy of your personal data or ask for corrections.</li>
            <li><strong>Data Deletion:</strong> You may request the deletion of your personal data unless required for legal purposes.</li>
            <li><strong>Opt-Out of Marketing Communications:</strong> You can unsubscribe from promotional emails at any time.</li>
            <li><strong>Cookie Preferences:</strong> You can manage cookie settings through your browser.</li>
        </ul>
        <p class="mb-4">To exercise your rights, contact us at <strong>info@collegeinfonepal.com</strong>.</p>
        
        <h2 class="text-2xl font-semibold mb-3">8. Data Retention</h2>
        <p class="mb-4">We retain personal information as long as necessary for college and course discovery purposes. If you request deletion, we will securely remove your data unless required by law.</p>
        
        <h2 class="text-2xl font-semibold mb-3">9. Third-Party Links</h2>
        <p class="mb-4">Our Website may contain links to third-party college portals, application platforms, or other external websites. We are not responsible for their privacy practices, so we encourage you to review their policies before sharing any personal information.</p>
        
        <h2 class="text-2xl font-semibold mb-3">10. Children's Privacy</h2>
        <p class="mb-4">Our services are intended for individuals aged 16 and above. We do not knowingly collect data from children under 16. If we become aware of such data, we will delete it immediately.</p>
        
        <h2 class="text-2xl font-semibold mb-3">11. Updates to This Privacy Policy</h2>
        <p class="mb-4">We may update this Privacy Policy from time to time. Changes will be posted on this page with an updated effective date. Continued use of our services after updates indicates acceptance of the revised policy.</p>
        
        <h2 class="text-2xl font-semibold mb-3">12. Contact Us</h2>
        <p class="mb-4">For any questions or concerns regarding this Privacy Policy, please contact us at:</p>
        <a href="mailto:info@collegeinfonepal.com" class="font-medium">📧 <strong>Email:</strong> info@collegeinfonepal.com</a>
        <p class="font-medium">📍 <strong>Address:</strong> Kritipur-10 ,Kathmandu</p>
    </div>
</body>

